(window.webpackJsonp=window.webpackJsonp||[]).push([[1350],{1705:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-2185-thanh-quang"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2185-thanh-quang"}},[n._v("#")]),n._v(" Chương 2185: Thanh quang")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Trong lòng nghi hoặc, lần nữa khởi động chân khí, hướng cùng một chỗ lan ra."),t("br"),t("br"),n._v("Trong nháy mắt, lại biến mất không thấy."),t("br"),t("br"),n._v("Liền giống như đối phương trong cơ thể, có một cỗ đặc thù lực lượng, có thể thôn phệ hắn Thiên đạo chân khí đồng dạng."),t("br"),t("br"),n._v("Trương Huyền híp mắt lại."),t("br"),t("br"),n._v("Thiên đạo chân khí Thần Vương cường giả nuốt, đều sẽ bị bản thân hạn chế, trước mắt cái này ngược lại tốt, tự thân truyền vào lực lượng, lại bị nuốt lấy... Chẳng lẽ, thực lực đối phương không ngừng hạ thấp, là bởi vì có loại này thôn phệ năng lực, không chỉ có thôn phệ người khác, ngay cả mình chân khí, đều không buông tha?"),t("br"),t("br"),n._v("“Nhìn ngươi có thể nuốt bao nhiêu!”"),t("br"),t("br"),n._v("Tràn đầy kỳ lạ, Trương Huyền cũng bị khơi dậy lòng háo thắng, chân khí trong cơ thể bắn ra, một đạo thô to khí tức, dọc theo đối phương mạch đập điên cuồng tràn vào."),t("br"),t("br"),n._v("Vừa mới vì phòng ngừa đối phương phát hiện, chỉ vận dụng một đạo khí tức cực kỳ nhỏ yếu, liền Thần Nguyên hoàn bên trong ẩn chứa cũng không bằng, bị thôn phệ không tính là gì, hiện tại chân khí tung hoành, không tin có đồ vật gì đó, có thể nuốt lấy!"),t("br"),t("br"),n._v("Thô to chân khí, như hồng thủy quán dũng, bị bắt lại bàn tay Phượng Cửu Ca khóe miệng giật một cái, con mắt đột nhiên trợn tròn, ngay sau đó cảm thấy một cỗ to lớn thiên địa uy áp, lật đổ mà đến, linh hồn đều muốn bị nghiền ép."),t("br"),t("br"),n._v("Muốn thu về bàn tay, lại phát hiện, tay của đối phương ngón tay kim cô đồng dạng, bất kể như thế nào đều kéo kéo không động đậy."),t("br"),t("br"),n._v("“Buông...”"),t("br"),t("br"),n._v("Muốn la lên, nhưng đối phương chân khí thực sự quá cường đại, vừa tiến vào trong cơ thể, lập tức cảm thấy tựa như bị không biết tên lực lượng nghiền ép, miệng há mở, lại một câu đều nói không đi ra."),t("br"),t("br"),n._v("Không biết đối phương muốn cho hắn ngừng, Trương Huyền con mắt khép hờ, tinh thần kèm theo Thiên đạo chân khí, cẩn thận cảm thụ đối phương trong cơ thể thôn phệ đầu nguồn."),t("br"),t("br"),n._v("Là một đạo màu xám tro khí lưu, nhìn không ra đến cùng là cái gì."),t("br"),t("br"),n._v("Khống chế chân khí trào lên đi, dòng khí màu xám lập tức thả ra thanh sắc quang mang."),t("br"),t("br"),n._v("“Không phải thôn phệ, mà là... Triệt tiêu lẫn nhau!”"),t("br"),t("br"),n._v("Trước đó còn tưởng rằng, là đối phương trong cơ thể xuất hiện cái gì vật kỳ quái, đem hắn Thiên đạo chân khí thôn phệ sạch sẽ, giờ phút này mới hiểu được, cũng không phải là thôn phệ, mà là triệt tiêu lẫn nhau."),t("br"),t("br"),n._v("Cái này dòng khí màu xám, có thể cùng Thiên đạo chân khí sinh ra đặc thù nào đó phản ứng, hai hai trung hòa thành thanh quang, cuối cùng toàn bộ biến mất."),t("br"),t("br"),n._v("“Không đúng, đối phương không thể hoàn toàn loại bỏ chân khí của ta!”"),t("br"),t("br"),n._v("Truyền vào một hồi, Trương Huyền phát hiện cái gì, nhịn không được cau mày."),t("br"),t("br"),n._v("Hắn Thiên đạo chân khí, là tại cùng đối diện khí lưu trung hòa, không ngừng biến mất, nhưng biến mất chỉ là một phần, còn có một phần, có thể lưu lại."),t("br"),t("br"),n._v("Căn cứ tỉ lệ tính toán, một trăm đạo, đại khái còn thừa lại một đạo."),t("br"),t("br"),n._v("“Đây là... Tinh luyện?”"),t("br"),t("br"),n._v("Ánh mắt lộ ra nghi hoặc."),t("br"),t("br"),n._v("Còn thừa lại đạo kia chân khí, có thể cảm nhận được, so trước đó tinh thuần mấy chục lần không ngừng, mặc dù không cách nào cảm nhận được lực lượng làm sao, lại cùng trước đó có rõ ràng thuế biến."),t("br"),t("br"),n._v("“Không phải tinh luyện, mà là... Đem Thiên đạo chân khí, cùng ta lĩnh ngộ Thiên Nhược Hữu Tình chân khí chia lìa...”"),t("br"),t("br"),n._v("Không có lĩnh ngộ Thiên Nhược Hữu Tình công pháp phía trước, Trương Huyền tu luyện chính là Thiên đạo công pháp, trong cơ thể cũng chính là cái gọi là Thiên đạo chân khí. Về sau mặc dù thay đổi công pháp, nhưng mà là Thiên đạo công pháp bản thăng cấp, hai loại chân khí vẫn như cũ xen lẫn trong trong cơ thể, không phân khác biệt."),t("br"),t("br"),n._v("Uy lực không sai biệt lắm, hơn nữa rất khó tách ra, cũng liền lười đi nghĩ những thứ này chuyện."),t("br"),t("br"),n._v("Không nghĩ tới, cái này màu xám thể khí, vậy mà làm được!"),t("br"),t("br"),n._v("Nó có thể trung hòa Thiên đạo chân khí, đối Thiên Nhược Hữu Tình chân khí, không có bất kỳ biện pháp nào, cho nên hai hai tiếp xúc, người sau liền bị còn lại xuống."),t("br"),t("br"),n._v("“Thuần túy Thiên Nhược Hữu Tình chân khí, ta còn không có dùng qua, nếu ngươi có thể tinh luyện, vậy thì tiếp tục...”"),t("br"),t("br"),n._v("Dù sao đều là tự mình tu luyện đi ra, Trương Huyền cũng không để ý, chân khí gào thét, lần nữa hướng thể đối phương trong cơ thể điên cuồng truyền vào."),t("br"),t("br"),n._v("Cả hai đối đầu, thanh quang thả ra, ánh sáng chói mắt."),t("br"),t("br"),n._v("Đối diện đạo kia dòng khí màu xám, tuy là chỉ có một đạo, lại có vẻ dị thường tinh thuần, Trương Huyền truyền vào lão đại một hồi chân khí, cũng chỉ tổn hao gần một nửa, vẫn như cũ có hơn phân nửa, xoay quanh trong đó."),t("br"),t("br"),n._v("Đang định thừa thế xông lên, đem cỗ lực lượng này triệt để tiêu hao sạch sẽ, liền cảm thấy có người đang quay bờ vai của mình."),t("br"),n._v("Cảm thụ lực lượng cùng động tác, biết không ác ý, Trương Huyền nhíu nhíu mày, trên tay chân khí, vẫn như cũ không ngừng truyền vào, người thì quay đầu nhìn lại, nhịn không được sững sờ."),t("br"),t("br"),n._v("Sau lưng chẳng biết lúc nào đống một đám người, chừng mấy chục nhiều, xem ra đều là ở đây ăn cơm, có mấy cái vừa vặn quen mặt, chính là trước đó thảo luận Phượng Cửu Ca trung niên nhân."),t("br"),t("br"),n._v("Đập hắn, là dẫn đầu một cái chống gậy trượng lão giả."),t("br"),t("br"),n._v("“Làm sao vậy?”"),t("br"),t("br"),n._v("Gặp những này cũng không nhận ra, lại đập bản thân, Trương Huyền có chút không hiểu."),t("br"),t("br"),n._v("“Lão hủ vốn không muốn quản việc không đâu, nhưng đây là Hỏa Phượng nhất tộc quản lý phạm vi, xảy ra sự tình, không có nói, một khi điều tra, phiền phức không ít, đối ngươi cũng không tốt lắm. Những người khác không tiện mở miệng, lão hủ lớn tuổi một ít, chỉ có thể ra mặt. Tại đây, chỉ muốn mạo muội hỏi một câu... Không biết vị bằng hữu này, vị này Phượng Cửu Ca cùng ngươi có cái gì thù hận?”"),t("br"),t("br"),n._v("Vuốt râu, lão giả mở miệng nói."),t("br"),t("br"),n._v("Âm thanh tràn đầy nho nhã, nghe xong liền biết đọc nhiều văn thơ."),t("br"),t("br"),n._v("Sửng sốt một chút, Trương Huyền lắc đầu: “Chúng ta cũng không thù oán ah!”"),t("br"),t("br"),n._v("Lão giả tràn đầy không hiểu: “Vậy ngươi vì sao, phải bắt được bàn tay của hắn...”"),t("br"),t("br"),n._v("Còn tưởng rằng chuyện gì, Trương Huyền cười cười, nói: “Thân thể của hắn có chút vấn đề, ta thân là y sư, ngay tại trị cho hắn, giải quyết tai hoạ ngầm...”"),t("br"),t("br"),n._v("“Có câu, lão hủ không đáng nói không đem nói, cũng không biết có nên hỏi hay không...”"),t("br"),t("br"),n._v("Nghe được giải thích của hắn, lão giả quay đầu liếc mắt nhìn, thấy mọi người biểu lộ đều không đúng, lúc này mới cắn răng tiếp tục mở miệng: “Ngươi xác định, hắn hiện tại bộ dáng này, là tại cứu hắn?”"),t("br"),t("br"),n._v("“Bộ dáng này?”"),t("br"),t("br"),n._v("Tràn đầy nghi hoặc, Trương Huyền xoay đầu lại, nhịn không được ngẩn ngơ."),t("br"),t("br"),n._v("Bản thân nắm lấy, cũng không phải là vừa mới cái kia phong thần tuấn lãng Phượng Cửu Ca, mà là cả người cao hai mét, thể trọng thoạt nhìn ít nhất hơn bốn trăm cân siêu cấp đại mập mạp."),t("br"),t("br"),n._v("“Ngươi là ai?”"),t("br"),t("br"),n._v("Vội vàng buông tay, Trương Huyền sợ hết hồn."),t("br"),t("br"),n._v("Lúc nào cái tên mập mạp này chạy tới?"),t("br"),t("br"),n._v("Đem Phượng Cửu Ca đổi, bản thân vậy mà đều không biết được?"),t("br"),t("br"),n._v("“Lão hủ biết hắn là ai, tận mắt nhìn thấy, tuyệt vô hư ngôn!” Thấy hắn bộ dáng này, lão giả gật gật đầu nhìn qua: “Hắn chính là Phượng Cửu Ca... Ngươi bắt được sau đó, chỉ chốc lát liền biến thành như vậy...”"),t("br"),t("br"),n._v("“Hắn là Phượng Cửu Ca?”"),t("br"),t("br"),n._v("Trương Huyền khóe miệng giật một cái."),t("br"),t("br"),n._v("Vừa mới cái tên này, cùng mình không kém quá cao, cũng không có mập như vậy, làm sao thời gian nháy mắt biến thành như vậy?"),t("br"),t("br"),n._v("“Chẳng lẽ là... Ta không ngừng truyền vào chân khí tạo thành?”"),t("br"),t("br"),n._v("Lông mày nhảy dựng."),t("br"),t("br"),n._v("Sẽ không phải là bởi vì hắn không ngừng truyền vào chân khí, hai hai giao hòa, thuế biến thành thanh quang, không cách nào tống ra... Cái tên này liền cùng thổi hơi bóng bay đồng dạng... Thành như vậy?"),t("br"),t("br"),n._v("Sẽ không như thế kéo đi!"),t("br"),t("br"),n._v("Nhìn kỹ lại, trước mắt “Cự nhân” quả nhiên là Phượng Cửu Ca plus+, mà không phải đột nhiên xuất hiện người lạ, Trương Huyền tràn đầy im lặng."),t("br"),t("br"),n._v("Ngắn ngủi vài phút không thấy, nhiều ra mấy trăm nhiều cân..."),t("br"),t("br"),n._v("Bất quá, không thể không nói, cái tên này béo thành như vậy, đổ cùng Dị Linh tộc nhân, thoạt nhìn có chút giống nhau."),t("br"),t("br"),n._v("Dị Linh tộc nhân, dáng người liền so nhân loại bình thường cao lớn hơn nhiều lắm."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-2199"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-2201"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);